import React from 'react';

const HomePage = () => {
  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <h1>Welcome to Quizzie!</h1>
      <p>You are now logged in.</p>
    </div>
  );
};

export default HomePage;
